'/*-------------------------------------',
' * javascript message',
' *-------------------------------------',
'*/',
'FUNCTION render(',
'  p_dynamic_action IN apex_plugin.t_dynamic_action',
', p_plugin         IN apex_plugin.t_plugin)',
'RETURN apex_plugin.t_dynamic_action_render_result IS',
'',
'  l_type    p_dynamic_action.attribute_01%type := p_dynamic_action.attribute_01;',
'  l_title   p_dynamic_action.attribute_02%type := p_dynamic_action.attribute_02;',
'  l_txt     p_dynamic_action.attribute_03%type := p_dynamic_action.attribute_03;',
'  l_result  apex_plugin.t_dynamic_action_render_result;',
'',
'BEGIN',
'  -- Debug',
'  IF apex_application.g_debug THEN',
'    apex_plugin_util.debug_dynamic_action(p_plugin         => p_plugin,',
'                                          p_dynamic_action => p_dynamic_action);',
'  END IF;',
'  ',
'  l_result.javascript_function := ',
'   ''function() { &APP_NAME..message.'' || l_type || ''({title: '' || apex_escape.js_literal(l_title) || '', text: '' || apex_escape.js_literal(l_txt) || ''})}'';',
'',
'  RETURN l_result;',
'  --',
'END render;'))
